import React from "react";

function Home(){
    return(
        <div>
            <h1>Home</h1>
            <h3>Welcome, the intent of this website is to provide a plethora of insight as to what I (Liam Mazure) have accomplished in my 22 years. Mainly focused on my computing related achievements, although I have provided additional information as to how I spend my time, outside of my career aspirations. I hope you find this insightful and gain a better understanding as to who I am along with what I am capable of achieving. I’ll leave you with this quote from Henry David Through to probe the continued exploration of your passions “It’s not what you look at that matters, it’s what you see”.</h3>
        </div>
    )
}

export default Home;
